import { Link } from "react-router-dom";

const Nav = ()=>{
    return(
        <div>
            <div>
         <h1>Muhammad Ali khan</h1>
         </div>
         <div>
            <li>
                <Link to="/">Home</Link>
            </li>
            <li>
                <Link to="/about">About</Link>
            </li>
            <li>
                <Link to="/skill">Skill</Link>
            </li>
         </div>
        </div>


    )
}
export default Nav;
